import {ApplicationService} from "./applicationService";
import {ApplicationStatus} from "../dto/application/applicationStatus";
import {transactionFunction} from "../db";
import {EnrollmentLists} from "../dto/application/rankedApplication";
import {ApplicationWithInfo} from "../dto/application/applicationWithInfo";
import {RankListService} from "./rankListService";
import {appendFile} from 'fs'
import {EnrollmentService} from "./enrollmentService";


export class AdminService {
    constructor(
        private rankListService: RankListService,
        private applicationService: ApplicationService,
        private enrollmentService: EnrollmentService,
        private readonly tx: transactionFunction
    ) {
    }

    async processProfileEnrollments() {
        const rankLists = await this.rankListService.getEnrollmentLists()
        const finalEnrollmentLists = this.finalizeEnrollmentProcess(rankLists)
        const applications = await this.updateApplicationStatuses(finalEnrollmentLists)
        await this.enrollmentService.endEnrollment();
        return applications
    }

    private finalizeEnrollmentProcess(rankLists: EnrollmentLists): EnrollmentLists {
        const acceptedByCandidate = new Map<number, ApplicationWithInfo>()
        const rejected: ApplicationWithInfo[] = []
        const applicationsToProcess: ApplicationWithInfo[] = rankLists.accepted
        const reserveByProfile = rankLists.reserveByProfile

        while(applicationsToProcess.length > 0) {
            const application = applicationsToProcess.pop()!
            const candidateId = application.candidate.id
            const candidateApplication = acceptedByCandidate.get(candidateId)

            const isLowerPriority = candidateApplication != null && candidateApplication.priority < application.priority

            const applicationToRemove = isLowerPriority? application : candidateApplication
            const applicationToAccept = isLowerPriority? candidateApplication : application

            acceptedByCandidate.set(candidateId, applicationToAccept)

            if (applicationToRemove == null) continue

            rejected.push(applicationToRemove)
            const reserve = reserveByProfile.get(applicationToRemove.profile.id)!
            const newApp = reserve.shift()
            if (!newApp) continue

            applicationsToProcess.push(newApp)
        }

        return {acceptedByCandidate, rejected, reserveByProfile} as EnrollmentLists
    }

    private async updateApplicationStatuses(finalEnrollmentLists: EnrollmentLists) {
        const updatedApplications: ApplicationWithInfo[] = []
        appendFile(
            'executionTime.txt',
            `${performance.now()} end\n`,
            (err) => {
                if (err) console.log("Error:" + err);
            }
        );
        await this.tx(async t => {
            for (const a of finalEnrollmentLists.rejected) {
                a.status = ApplicationStatus.Rejected
                await this.applicationService.updateApplicationStatus(a.id, a.status, t);
                updatedApplications.push(a);
            }
            for (const [_candidateId, a] of finalEnrollmentLists.acceptedByCandidate){
                a.status = ApplicationStatus.Accepted
                await this.applicationService.updateApplicationStatus(a.id, a.status, t);
                updatedApplications.push(a);
            }
            for (const [_profileId, reserve] of finalEnrollmentLists.reserveByProfile){
                for (const a of reserve) {
                    a.status = ApplicationStatus.Rejected
                    await this.applicationService.updateApplicationStatus(a.id, a.status, t);
                    updatedApplications.push(a);
                }
            }
        });
        return updatedApplications;
    }
}

export enum ApplicationStatus {
    Pending = 'OczekujÄcy',
    Accepted = 'PrzyjÄty',
    Rejected = 'Odrzucony',
}

import {ITask} from "pg-promise";

import {ApplicationRepository} from '../repositories/applicationRepository';
import {ResourceNotFoundError} from "../errors/resourceNotFoundError";
import {DataConflictError} from "../errors/dataConflictError";
import {SchoolService} from "./schoolService";
import {ProfileService} from "./profileService";
import {ApplicationWithProfiles} from "../dto/application/applicationWithProfiles";
import {ApplicationBySchool} from "../dto/application/applicationBySchool";
import {ApplicationRequest} from "../dto/application/applicationRequest";
import {ApplicationEntity} from "../models/applicationEntity";
import {Application} from "../dto/application/application";
import {EnrollmentService} from "./enrollmentService";
import {ValidationError} from "../errors/validationError";
import {Enrollment} from "../dto/enrollment";
import {ApplicationStatus} from "../dto/application/applicationStatus";
import {transactionFunction} from "../db";
import {SCHOOL_MAX} from "../../../public/adminConstants";

export class ApplicationService {
    private profileService!: ProfileService;

    constructor(
        private applicationRepository: ApplicationRepository,
        private enrollmentService: EnrollmentService,
        private schoolService: SchoolService,
        private readonly tx: transactionFunction
    ) {
    }

    setProfileService(profileService: ProfileService) {
        this.profileService = profileService;
    }

    /**
     * Pobiera wszystkie aplikacje wraz z profilami zÅoÅ¼one przez podanego kandydata.
     * JeÅ¼eli podano identyfikator naboru, to zwrÃ³cone aplikacje naleÅ¼Ä tylko do okreÅlonego naboru
     *
     * @param {number} candidateId - identyfikator kandydata.
     * @param {number} enrollmentId - identyfikator tury naboru.
     * @returns {Promise<School>} Zwraca tablicÄ obiektÃ³w aplikacji z profilami. Obiekty te zawierajÄ:
     *
     *  id: number - identyfikator aplikacji
     *  round: number - turÄ naboru
     *  school: SchoolWithProfiles - obiekt szkoÅy do ktÃ³rej zÅoÅ¼ono aplikacjÄ wraz ze wszystkimi profilami szkoÅy
     *  profile: Profile - obiekt profilu do ktÃ³rego zÅoÅ¼ono aplikacjÄ
     *  priority: number - priorytet
     *  status: string - status aplikacji
     *  createdAt: Date | number - data utworzenia aplikacji
     *  updatedAt: Date | number - data modyfikacji aplikacji
     */
    async getAllApplications(candidateId: number, enrollmentId?: number): Promise<ApplicationWithProfiles[]> {
        const applications = enrollmentId != null?
            await this.applicationRepository.getAllByCandidateAndEnrollmentId(candidateId, enrollmentId) :
            await this.applicationRepository.getAllByCandidate(candidateId);

        return Promise.all(
            applications.map(async (app) => {
                const [enrollment, profile] = await Promise.all([
                    this.enrollmentService.getEnrollment(app.enrollmentId),
                    this.profileService.getProfile(app.profileId),
                ]);
                const school = await this.schoolService.getSchoolWithProfiles(profile.schoolId)

                return {
                    id: app.id,
                    school: school,
                    profile: profile,
                    priority: app.priority,
                    round: enrollment.round,
                    status: app.status,
                    createdAt: app.createdAt,
                    updatedAt: app.updatedAt
                };
            })
        )
    }

    /**
     * Pobiera wszystkie aplikacje ze statusem oczekujÄcym dla podanego profilu
     *
     * @param {number} profileId - identyfikator profilu.
     * @returns {Promise<Application[]>} Zwraca tablicÄ obiektÃ³w oczekujÄcych aplikacji. Obiekty te zawierajÄ:
     *
     *  id: number - identyfikator aplikacji
     *  profileId: number - identyfikator profilu
     *  candidateId: number - identyfikator kandydata
     *  priority: number - priorytet
     *  status: string - status aplikacji
     */
    async getAllPendingByProfile(profileId: number): Promise<Application[]> {
        return this.applicationRepository.getAllByProfileAndStatus(profileId, ApplicationStatus.Pending);
    }

    /**
     * Pobiera wszystkie aplikacje ze statusem zaakceptowanym dla podanego profilu
     *
     * @param {number} profileId - identyfikator profilu.
     * @returns {Promise<Application[]>} Zwraca tablicÄ obiektÃ³w zaakceptowanych aplikacji. Obiekty te zawierajÄ:
     *
     *  id: number - identyfikator aplikacji
     *  profileId: number - identyfikator profilu
     *  candidateId: number - identyfikator kandydata
     *  priority: number - priorytet
     *  status: string - status aplikacji
     */
    async getAllAcceptedByProfile(profileId: number): Promise<Application[]> {
        return this.applicationRepository.getAllByProfileAndStatus(profileId, ApplicationStatus.Accepted)
    }

    /**
     * Pobiera wszystkie oczekujÄce w obecnej turze aplikacje zÅoÅ¼one przez podanego kandydata, pogrupowane ze wzglÄdu na szkoÅy.
     * Zatem wszystkie profile naleÅ¼Äce do danej szkoÅy, do ktÃ³rych zÅoÅ¼yÅ aplikacjÄ kandydat, bÄdÄ w jednej grupie.
     *
     * @param {number} candidateId - identyfikator kandydata.
     * @returns {Promise<ApplicationBySchool[]>} Zwraca tablicÄ obiektÃ³w pogrupowanych aplikacji. Obiekty te zawierajÄ:
     *
     *  - school: SchoolWithProfiles - szkoÅÄ wraz ze wszystkimi profilami naleÅ¼Äcymi do tej szkoÅy
     *  - profiles:  ApplicationRequest[]:
     *
     *     - profileId: number - identyfikator profilu
     *     - priority: number - priorytet
     */
    async getAllApplicationSubmissions(candidateId: number): Promise<ApplicationBySchool[]> {
        const enrollment: Enrollment | null = await this.enrollmentService.getCurrentEnrollment();
        if (!enrollment) throw new ValidationError('Nie pobraÄ aplikacji poza okresem naboru.');
        const applications: ApplicationWithProfiles[] = await this.getAllApplications(candidateId, enrollment.id);
        return this.groupApplicationsBySchool(applications);
    }

    /**
     * Aktualizuje status podanej aplikacji, na ten, podany w argumencie.
     *
     * @param {number} id - identyfikator aplikacji.
     * @param {ApplicationStatus} status - status aplikacji ("OczekujÄcy" | "PrzyjÄty" | "Odrzucony"
     * @param {ITask<any>} t - obiekt transakcji
     * @returns {Promise<void>}
     */
    async updateApplicationStatus(id: number, status: ApplicationStatus, t: ITask<any>): Promise<void> {
        return this.applicationRepository.updateStatus(id, status, t);
    }


    /**
     * Dodaje nowe aplikacje zÅoÅ¼one przez podanego kandydata.
     *
     * @param {number} candidateId - identyfikator kandydata skÅadajÄcego aplikacje.
     * @param {ApplicationRequest[]} submissions - tablica  obiektÃ³w aplikacji, ktÃ³re zawierajÄ:
     *
     *  - profileId: number - identyfikator profilu
     *  - priority: number - priorytet aplikacji
     * @returns {Promise<void>}
     *
     * @throws {ValidationError} JeÅli kandydat prÃ³buje zÅoÅ¼yÄ aplikacjÄ poza okresem naboru
     * @throws {DataConflictError} JeÅli kandydat juÅ¼ wczeÅniej zÅoÅ¼yÅ aplikacjÄ
     */
    async addApplication(submissions: ApplicationRequest[], candidateId: number): Promise<void> {
        const enrollment: Enrollment | null = await this.enrollmentService.getCurrentEnrollment();
        if (!enrollment) throw new ValidationError('Nie moÅ¼na zÅoÅ¼yÄ aplikacji poza okresem naboru.');

        const existingApplications: Application[] = await this.applicationRepository.getAllByCandidateAndEnrollmentId(candidateId, enrollment.id);
        if (existingApplications.length > 0) throw new DataConflictError('Aplikacja juÅ¼ istnieje.');

        await this.validateProfiles(submissions);
        this.assignPriorities(submissions);

        await this.tx(async t => {
            for (const submission of submissions) {
                const newApplication = this.createApplicationEntity(submission, candidateId, enrollment.id);
                await this.applicationRepository.insert(newApplication, t);
            }
        });
    }

    /**
     * Aktualizuje aplikacje zÅoÅ¼one przez podanego kandydata.
     *
     * @param {number} candidateId - identyfikator kandydata edytujÄcego aplikacje.
     * @param {ApplicationRequest[]} submissions - tablica  obiektÃ³w aplikacji, ktÃ³re zawierajÄ:
     *
     *  - profileId: number - identyfikator profilu
     *  - priority: number - priorytet aplikacji
     * @returns {Promise<void>}
     *
     * @throws {ValidationError} JeÅli kandydat prÃ³buje edytowaÄ aplikacjÄ poza okresem naboru
     * @throws {ResourceNotFoundError} JeÅli nie znaleziono aplikacji
     */
    async updateApplication(submissions: ApplicationRequest[], candidateId: number): Promise<void> {
        const enrollment: Enrollment | null = await this.enrollmentService.getCurrentEnrollment();
        if (!enrollment) throw new ValidationError('Nie moÅ¼na zÅoÅ¼yÄ aplikacji poza okresem naboru.');

        const applications: Application[] = await this.applicationRepository.getAllByCandidateAndEnrollmentId(candidateId, enrollment.id);
        if (applications.length === 0) throw new ResourceNotFoundError('Nie odnaleziono aplikacji.');

        await this.validateProfiles(submissions);
        this.assignPriorities(submissions);

        await this.tx(async t => {
            for (const application of applications) {
                await this.applicationRepository.delete(application.profileId, application.candidateId, t);
            }
            for (const submission of submissions) {
                const newApplication = this.createApplicationEntity(submission, candidateId, enrollment.id);
                await this.applicationRepository.insert(newApplication, t);
            }
        });
    }

    /**
     * Aktualizuje status aplikacji o podanym identyfikatorze na odrzucony. Wymaga profilu,
     * aby uwierzytelniÄ Å¼e aktualizacje przeprowadza administrator szkolny, ktÃ³ry ma dostÄp do zarzÄdzania tÄ aplikacjÄ
     *
     * @param {number} id - identyfikator aplikacji.
     * @param {number} profileId - identyfikator profilu.
     * @returns {Promise<void>}
     *
     * @throws {ResourceNotFoundError} JeÅli nie znaleziono aplikacji
     */
    async rejectApplication(id: number, profileId: number): Promise<void> {
        const application = await this.applicationRepository.getById(id);
        if (!application || profileId != application.profileId) throw new ResourceNotFoundError("Nie znaleziono aplikacji do usuniÄcia.");
        await this.applicationRepository.rejectById(id);
    }

    private createApplicationEntity(submission: ApplicationRequest, candidateId: number, enrollmentId: number): ApplicationEntity {
        return {
            id: 0,
            candidateId,
            profileId: submission.profileId,
            priority: submission.priority,
            enrollmentId,
            status: ApplicationStatus.Pending,
            createdAt: new Date(),
            updatedAt: new Date(),
        };
    }

    private async validateProfiles(submissions: ApplicationRequest[]) {
        const schoolIds = new Set<number>();

        for (const submission of submissions) {
            const profile = await this.profileService.getProfile(submission.profileId);
            if (profile && profile.schoolId) {
                schoolIds.add(profile.schoolId);
            }
        }

        if (schoolIds.size > SCHOOL_MAX) throw new ValidationError("Przekroczono dopuszczalnÄ liczbÄ szkÃ³Å");
    }

    private assignPriorities(submissions: ApplicationRequest[]) {
        submissions = submissions.sort(
            (a, b) => a.priority - b.priority
        );

        submissions.forEach((item, index) => {
            item.priority = index + 1;
        });
    }

    private groupApplicationsBySchool(applications: ApplicationWithProfiles[]) {
        const groupedBySchool: ApplicationBySchool[] = [];
        for (const app of applications) {
            let schoolGroup = groupedBySchool.find(group =>
                group.school.id === app.school.id
            );
            if (!schoolGroup) {
                schoolGroup = {
                    school: app.school,
                    profiles: [],
                };
                groupedBySchool.push(schoolGroup);
            }

            schoolGroup.profiles.push({
                profileId: app.profile.id,
                priority: app.priority,
            });
        }
        return groupedBySchool;
    };
}

import {CustomError} from "./customError";

export class ResourceNotFoundError extends CustomError {
    constructor(message: string = 'Data does not exist') {
        super(message, 404);
    }
}

export class CustomError extends Error {
    public statusCode: number;
    public message: string;
    public isOperational: boolean;

    constructor(message: string, statusCode: number, isOperational: boolean = true) {
        super(message);
        this.statusCode = statusCode;
        this.message = message;
        this.isOperational = isOperational;

        Error.captureStackTrace(this, this.constructor);
    }
}

import {CustomError} from "./customError";

export class DataConflictError extends CustomError {
    constructor(message: string = 'Data already exists') {
        super(message, 409);
    }
}

import {CustomError} from "./customError";
import {ValidationError as ExpressValidationError} from "express-validator";

export class ValidationError extends CustomError {
    public errors: ExpressValidationError[];

    constructor(message: string, errors: ExpressValidationError[] = []) {
        super(message, 400);
        this.errors = errors;
    }
}

import {ProfileCriteriaEntity, ProfileCriteriaType} from "../models/profileCriteriaEntity";
import {ProfileCriteria} from "../dto/criteriaByProfile";
import {Grade} from "../dto/grade/grade";
import {GradeService} from "./gradeService";
import {Application} from "../dto/application/application";
import {CandidateService} from "./candidateService";
import {appendFile} from 'fs';
import {EnrollmentLists, RankedApplication, RankList} from "../dto/application/rankedApplication";
import {GRADE_TO_POINTS} from "../../../public/adminConstants";
import {GradeType} from "../dto/grade/gradeType";
import {GradesInfo, PointsInfo} from "../dto/grade/pointsInfo";
import {SubjectService} from "./subjectService";
import {ProfileWithInfo} from "../dto/profile/profileInfo";
import { ProfileService } from "./profileService";
import { CandidateWithGrades } from "../dto/candidate/candidateWithGrades";
import { ApplicationWithInfo } from "../dto/application/applicationWithInfo";

export class RankListService {

    constructor(
        private gradeService: GradeService,
        private subjectService: SubjectService,
        private candidateService: CandidateService,
        private profileService: ProfileService
    ) {
    }

    /**
     *  Pobiera informacjÄ o punktach, ktÃ³re zdobyÅ podany kandydat do profilu.
     *
     * @param {number} id - identyfikator profilu.
     * @param {number} candidateId - identyfikator kandydata kandydujÄcego do tego profilu.
     * @returns {Promise<PointsInfo>} Zwraca obiekt informacji o punktach, ktÃ³ry zawiera:
     *
     * - points: (number) - iloÅÄ zdobytych punktÃ³w do profilu, obliczona w oparci o oceny kandydata oraz kryteria profilu.
     * - gradesInfo: (GradesInfo) - obiekt zawierajÄcy informacje o ocenach ze Åwiadectwa kandydata:
     *
     *      - grade- wartoÅÄ oceny
     *      - subject- przedmiot, z ktÃ³rego jest ocena
     *      - type- typ kryterium rekrutacyjnego jakie speÅnia przedmiot dla danego profilu (czy jest to kryterium obowiÄzkowe, czy alternatywne)
     *
     * @throws {ResourceNotFoundError} JeÅli nie znaleziono kryteriÃ³w dla podanego profilu.
     */
    async getPoints(id: number, candidateId: number): Promise<PointsInfo> {
        const [criteria, grades] = await Promise.all([
            this.profileService.getProfileCriteria(id),
            this.gradeService.getAllByCandidate(candidateId)
        ]);

        const gradesInfo = await this.getGradesInfo(grades, criteria);

        return {points: this.calculatePoints(criteria, grades), gradesInfo};
    }

    private async getGradesInfo(grades: Grade[], criteria: ProfileCriteria[]): Promise<GradesInfo[]> {
        const gradesInfoPromises = grades.map(async grade => {
            const criterion = criteria.find(c => c.subjectId === grade.subjectId && grade.type === GradeType.Certificate)
            if (!criterion) return null

            const subject = await this.subjectService.getSubject(grade.subjectId)
            return {grade: grade.grade, subject: subject.name, type: criterion.type}
        })
        return (await Promise.all(gradesInfoPromises)).filter(grade => grade !== null)
    }

    /**
     *  Pobiera listÄ rekrutacyjnÄ dla podanego profilu.
     *  Listy rekrutacyjne sÄ sortowane wedÅug punktÃ³w uzyskanych przez kandydatÃ³w.
     *
     * @param {number} id - identyfikator profilu.
     * @returns {Promise<RankList>} Zwraca listÄ rekrutacyjnÄ, na ktÃ³rÄ skÅada siÄ:
     *
     *  - prevAccepted: lista kandydatÃ³w przyjÄtych w poprzednich turach
     *  - accepted: lista kandydatÃ³w kwalifikujÄcych siÄ w obecnej turze
     *  - reserve: lista kandydatÃ³w niekwalifikujÄcych siÄ, ktÃ³rzy sÄ na liÅcie rezerwowej
     *
     * @throws {ResourceNotFoundError} JeÅli nie znaleziono kryteriÃ³w dla profilu.
     */
    async getRankListById(id: number): Promise<RankList> {
        const [candidatesWithGrades, profile] = await Promise.all([
            this.candidateService.getAllWithGrades(),
            this.profileService.getProfileWithInfo(id)
        ]);
       return this.createRankList(profile, candidatesWithGrades);
    }

    /**
     *  Pobiera wszystkie listy rekrutacyjne dla kaÅ¼dego profilu wraz z dodatkowymi informacjami.
     *
     * @returns {Promise<EnrollmentLists>} Zwraca obiekt, zawierajÄcy:
     *
     * accepted - listÄ zaakceptowanych aplikacji
     * rejected - zainicjalizowana lista odrzuconych aplikacji
     * reserveByProfile - mapÄ, dla ktÃ³rej:
     *      klucz - identyfikator profilu 
     *      wartoÅÄ - lista rezerwowa kandydatÃ³w
     *
     * @throws {ResourceNotFoundError} JeÅli nie znaleziono kryteriÃ³w dla profilu.
     */
    async getEnrollmentLists(): Promise<EnrollmentLists> {
        const [candidatesWithGrades, profiles] = await Promise.all([
            this.candidateService.getAllWithGrades(),
            this.profileService.getProfilesWithInfo()
        ]);

        appendFile(
            'executionTime.txt',
            `${performance.now()} start\n`,
            (err) => {
                if (err) console.log("Error:" + err);
            }
        );
        const reserveByProfile = new Map<number, ApplicationWithInfo[]>();
        const allAccepted: ApplicationWithInfo[] = []

        profiles.forEach(profile => {
            const {accepted, reserve} = this.createRankList(profile, candidatesWithGrades)
            reserveByProfile.set(profile.id, reserve)
            allAccepted.push(...accepted)
        });

        return {reserveByProfile, accepted: allAccepted, rejected: [], acceptedByCandidate: new Map<number, ApplicationWithInfo>};
    }

    private createRankList(profile: ProfileWithInfo, candidatesWithGrades: CandidateWithGrades[]) {
        const rankedAccepted = this.rankApplications(profile.accepted, profile, candidatesWithGrades)
        const rankedPending = this.rankApplications(profile.pending, profile, candidatesWithGrades)
        const capacity = profile.capacity - rankedAccepted.length;

        return {
            prevAccepted: rankedAccepted,
            accepted: rankedPending.slice(0, capacity),
            reserve: rankedPending.slice(capacity)
        };
    }

    private rankApplications(applications: Application[], profile: ProfileWithInfo, candidatesWithGrades: CandidateWithGrades[]) {
        return applications
            .map(a => this.rankApplication(profile, a, candidatesWithGrades.find(c => c.candidate.id === a.candidateId)!))
            .sort((a, b) => b.points - a.points);
    }

    private rankApplication(profile: ProfileWithInfo, application: Application, candidateWithGrades: CandidateWithGrades): ApplicationWithInfo {
        const points = this.calculatePoints(profile.criteria, candidateWithGrades.grades);
        return {
            id: application.id,
            candidate: candidateWithGrades.candidate,
            points,
            priority: application.priority,
            status: application.status,
            profile
        }
    }

    private calculatePoints(profileCriteria: ProfileCriteriaEntity[], grades: Grade[]): number {
        const mandatorySubjects = profileCriteria.filter(s => s.type === ProfileCriteriaType.Mandatory);
        const alternativeSubjects = profileCriteria.filter(s => s.type === ProfileCriteriaType.Alternative);

        let points = 0;
        let alternativeGrades = []

        for (const grade of grades) {
            if (grade.type === GradeType.Exam) 
                points += grade.grade * 0.35;
            else if (mandatorySubjects.some(s => s.subjectId == grade.subjectId))
                points += GRADE_TO_POINTS[grade.grade] || 0;
            else if (alternativeSubjects.some(s => s.subjectId == grade.subjectId))
                alternativeGrades.push(GRADE_TO_POINTS[grade.grade] || 0);
        }

        if (alternativeGrades.length > 0) points += Math.max(...alternativeGrades);

        return Math.ceil(points * 100) / 100;
    }
}

import { Subject } from "../dto/subject";

export enum ProfileCriteriaType {
    Mandatory = 'mandatory',
    Alternative = 'alternative',
}

export interface ProfileCriteriaEntity {
    id: number;
    profileId: number;
    subjectId: number;
    type: ProfileCriteriaType;
}

export interface ProfileCriteriaWithSubjects {
    id: number;
    profileId: number;
    subjectId: number;
    subjectName: string;
    type: ProfileCriteriaType;
}

export enum GradeType {
    Exam = 'exam',
    Certificate = 'certificate',
}

import {EnrollmentRepository} from "../repositories/enrollmentRepository";
