     *    id: number - identyfikator naboru
     *    round: number - turÄ
     *    startDate: Date - datÄ rozpoczÄcia
     *    endDate: Date - datÄ zakoÅczenia
     *
     *    lub null jeÅli obecnie nie ma okresu naboru.
     */
    async getCurrentEnrollment(): Promise<Enrollment | null> {
