    }


    /**
     * Pobiera wszystkie tury w danym roku
     *
     * @returns {Promise<Enrollment[]>} Zwraca tablicÄ naborÃ³w (tur, w danym roku)
     */
    async getCurrentYearEnrollments(): Promise<Enrollment[]> {
        return this.enrollmentRepository.getAllFromCurrentYear();
    }

    /**
     * Pobiera wszystkie tury z bazy danych
     *
     * @returns {Promise<Enrollment[]>} Zwraca obiekt naboru, zawierajÄcy:
     *
     * @returns {Promise<Enrollment[]>} Zwraca tablicÄ naborÃ³w
     */
    async getAllEnrollments(): Promise<Enrollment[]> {
        return this.enrollmentRepository.getAll();
    }

    /**
     *  Aktualizuje podane nabory poprzez:
     *
     *  - dodanie naborÃ³w, ktÃ³rych id nie jest obecne w bazie danych
     *  - usuniÄcie naborÃ³w, ktÃ³rych nie ma w podanych naborach, a ktÃ³re sÄ obecne w bazie danych
     *  - zaktualizowanie naborÃ³w ktÃ³rych id jest obecne w podanych naborach oraz w bazie danych.
     *
     * @param {Enrollment[]} enrollments - tablica obiektÃ³w naborÃ³w do aktualizowania.
     * @returns {Promise<void>}
     */
    async updateEnrollments(enrollments: Enrollment[]): Promise<void> {
        const currentEnrollments = await this.getAllEnrollments();
        const currentEnrollmentIds = currentEnrollments.map(s => s.id);
        const newEnrollmentIds = enrollments.map(s => s.id);

        const enrollmentsToUpdate = enrollments.filter(s =>
            currentEnrollmentIds.includes(s.id)
        );
        const enrollmentsToDelete = currentEnrollments.filter(s =>
            !newEnrollmentIds.includes(s.id)
        );
        const enrollmentsToAdd = enrollments.filter(s =>
            !currentEnrollmentIds.includes(s.id)
        );

        await this.tx(async t => {
            for (const enrollment of enrollmentsToDelete) {
                await this.enrollmentRepository.delete(enrollment.id, t);
            }
            for (const enrollment of enrollmentsToUpdate) {
                await this.enrollmentRepository.update(enrollment, t);
            }
            for (const enrollment of enrollmentsToAdd) {
                await this.enrollmentRepository.insert(enrollment, t);
            }
        });
    }
}

import {db, ITask} from '../db';
import {ApplicationEntity} from "../models/applicationEntity";
import {ApplicationStatus} from "../dto/application/applicationStatus";

export class ApplicationRepository {

    async getAllByCandidateAndEnrollmentId(candidateId: number, enrollmentId: number): Promise<ApplicationEntity[]> {
        const query = `
            SELECT a.candidate_id as candidate_id,
                   p.id           AS profile_id,
                   s.id           AS school_id,
                   a.priority,
                   a.status,
                   a.enrollment_id,
                   a.created_at,
                   a.updated_at
            FROM applications a
                     JOIN profiles p ON a.profile_id = p.id
                     JOIN schools s ON p.school_id = s.id
            WHERE candidate_id = $1
              AND enrollment_id = $2 AND a.status = $3
        `;

        return await db.query(query, [candidateId, enrollmentId, ApplicationStatus.Pending]);
    }

    async getAllByCandidate(candidateId: number): Promise<ApplicationEntity[]> {
        const query = `
            SELECT a.id,
                   a.candidate_id,
                   p.id AS profile_id,
                   s.id AS school_id,
                   a.priority,
                   a.status,
                   a.enrollment_id,
                   a.created_at,
                   a.updated_at
            FROM applications a
                     JOIN profiles p ON a.profile_id = p.id
                     JOIN schools s ON p.school_id = s.id
            WHERE candidate_id = $1
            ORDER BY date_part('year', a.updated_at) DESC, a.priority
        `;

        return await db.query(query, [candidateId]);
    }

    async getAllPendingByCandidate(candidateId: number): Promise<ApplicationEntity[]> {
        const query = `
            SELECT a.id,
                   a.candidate_id,
                   p.id AS profile_id,
                   s.id AS school_id,
                   a.priority,
                   a.status,
                   a.enrollment_id,
                   a.created_at,
                   a.updated_at
            FROM applications a
                     JOIN profiles p ON a.profile_id = p.id
                     JOIN schools s ON p.school_id = s.id
            WHERE candidate_id = $1 AND a.status = $2
            ORDER BY date_part('year', a.updated_at) DESC, a.priority
        `;

        return await db.query(query, [candidateId, ApplicationStatus.Pending]);
    }

    async updateStatus(id: number, status: string, t: ITask<any>): Promise<void> {
        const query = `
            UPDATE applications
            SET status = $2
            WHERE id = $1
        `;

        await t.none(query, [id, status]);
    }

    async getById(id: number): Promise<ApplicationEntity | null> {
        const query = `
            SELECT *
            FROM applications
            WHERE id = $1
            LIMIT 1;
        `;

        return await db.oneOrNone(query, [id]);
    }

    async rejectById(id: number): Promise<void> {
        const query = `
            UPDATE applications
            SET status = $2
            WHERE id = $1
        `;

        await db.none(query, [id, ApplicationStatus.Rejected]);
    }

    async getAllByProfileAndStatus(profileId: number, status: ApplicationStatus): Promise<ApplicationEntity[]> {
        const query = `
            SELECT *
            FROM applications
            WHERE profile_id = $1
              and status = $2
        `;

        return db.query(query, [profileId, status]);
    }

    async insert(newApp: ApplicationEntity, t: ITask<any>): Promise<void> {
        const query = `
            INSERT INTO applications (candidate_id, profile_id, priority, enrollment_id, status)
            VALUES ($1, $2, $3, $4, $5)
        `;

        await t.none(
            query,
            [newApp.candidateId, newApp.profileId, newApp.priority, newApp.enrollmentId, newApp.status]
        );
    }

    async delete(profileId: number, candidateId: number, t: ITask<any>): Promise<void> {
        const query = `
            DELETE
            FROM applications
            WHERE profile_id = $1
              AND candidate_id = $2
        `;

        await t.none(query, [profileId, candidateId]);
    }
}

import pgPromise, {ITask} from 'pg-promise';
import dotenv from 'dotenv';

dotenv.config();

const pgp = pgPromise({
    receive(e) {
        camelizeColumns(e.data);
    }
});

function camelizeColumns(data: any[]) {
    const tmp = data[0];
    for (const prop in tmp) {
        const camel = pgp.utils.camelize(prop);
        if (!(camel in tmp)) {
            for (let i = 0; i < data.length; i++) {
                const d = data[i];
                d[camel] = d[prop];
                delete d[prop];
            }
        }
    }
}


const db = pgp({
    host: process.env.DB_HOST,
    port: process.env.DB_PORT ? parseInt(process.env.DB_PORT, 10) : 5432,
    database: process.env.DB_NAME,
    user: process.env.DB_USER,
    password: process.env.DB_PASSWORD,
});

type transactionFunction = (callback: (t: ITask<any>) => Promise<void>) => Promise<void>;

const tx: transactionFunction = async (callback) => {
    return db.tx(callback);
};

export {db, tx, transactionFunction, ITask};

