        return profile;
    }

    /**
     *  Usuwa profil z bazy danych na podstawie podanego identyfikatora profilu oraz identyfikatora szkoÅy.
     *  Identyfikator szkoÅy sÅuÅ¼y do potwierdzenia czy jednostka szkolna ma uprawnienia do usuniÄcia tego profilu (tj. czy profil naleÅ¼y do tej szkoÅy).
     *
     * @param {number} id - identyfikator profilu.
     * @param {number} schoolId - identyfikator szkoÅy do ktÃ³rej naleÅ¼y profil.
     * @returns {Promise<void>}
     *
